import React, { useEffect, useState } from "react";

import { useHistory } from "react-router";

import { Body, Wrapper, Content, Image, Info, Icons } from "./Profile.style";
import axios from "axios";

import IMAGE from "../../images/navback.jpg";
import Navbar from "../Navbar/Navbar";

const Profile = () => {
  const [userData, setUserData] = useState({});
  const History = useHistory();

  useEffect(async () => {
    try {
      const res = await axios.get("http://localhost:3001/Profile");
      console / log(res);
      setUserData(res.data);
    } catch (err) {
      History.push("/Login");
    }
  }, []);

  return (
    <>
      <Navbar />
      <Body>
        <Wrapper>
          <Content>
            <Image src={IMAGE} />
            {/* <div className = 'backImage'><Image src={IMAGE} /></div> */}
            <Info>
              <div>
                <h1>{userData.userName}</h1>
                <hr style={{ width: "20rem" }} className="line" />
                <div className="info-split">
                  <div>
                    <h5>posts</h5>
                    <h5>Followers</h5>
                    <h5>Following</h5>
                    <br />
                    <div className="edit-icon">
                      <a href="#">
                        <button>
                          <i
                            className="far fa-edit"
                            style={{ color: "Green" }}
                          ></i>
                        </button>
                      </a>
                      <a href="##">
                        <button>
                          <i
                            className="fas fa-trash"
                            style={{ color: "Red" }}
                          ></i>
                        </button>
                      </a>
                    </div>
                  </div>
                  <div>
                    <h5>1</h5>
                    <h5>50</h5>
                    <h5>47</h5>
                  </div>
                </div>
              </div>
            </Info>
          </Content>
          <hr />
          <Icons>
            <i
              className="fas fa-images fa-2x hover-underline-animation"
              title="Posts"
            ></i>
            <i
              className="fas fa-users fa-2x hover-underline-animation"
              title="Followers"
            ></i>
            <i
              className="fas fa-user-friends fa-2x hover-underline-animation"
              title="Following"
            ></i>
          </Icons>
          <hr className="hover-underline-animation" />
        </Wrapper>
      </Body>
    </>
  );
};

export default Profile;
